    return(
      <div className="cards">
              <h4>{name}</h4>
              <img className="imagen" src={image} alt="" width="200px" height="200px"/>
              <h6>{diet ? diet : <h6>Withouth categories</h6>}</h6>
              <div>
                   <h3>Show Recipe</h3>
              </div>                           
      </div>
        );
}
